import React from 'react'
import { Link } from 'react-router-dom';

const Nav = () => {
  
    return (
      <>
      <nav>
         <ul>
         <Link to="/Home">Home</Link>
         <Link to="/ProductList">ProductList</Link>
         <Link to="/ProductDetail">Productdetail</Link>
         </ul>
      </nav>
  
  </>
    );
  };
  
  export default Nav;
